 also the sleep time showed that the very active users burned calories faster and slept better.\n","    \n","* With the data generated, the company can move forward to marketing messages that target on how very active users can improve sleep and stress conditions by using the fitness device tor track their sleep patern and daily activities in order to have a better quality of life."]},{"cell_type":"markdown","id":"e4fe9506","metadata":{"papermill":{"duration":0.044888,"end_time":"2021-12-27T09:15:00.082365","exception":false,"start_time":"2021-12-27T09:15:00.037477","status":"completed"},"tags":[]},"source":["## Thanks for reading!"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"3.6.3"},"papermill":{"default_parameters":{},"duration":11.280848,"end_time":"2021-12-27T09:15:00.238909","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2021-12-27T09:14:48.958061","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}